const AdminPage = () => {
  return (
    <div className="flex h-screen w-full bg-blue-500">
      <div className="flex py-20 px-5 gap-20 w-full ">
        <div className="flex w-1/8 flex-col bg-white">
          <div>Home</div>
          <div>Upload Listings</div>
          <div>Listings</div>
        </div>
        <div className="flex w-3/4 flex-col bg-white">..</div>
      </div>
    </div>
  );
};

export default AdminPage;
